import "./NewsCard.css";

export default function NewsCard({ articleId, cover, title, publishDate, authorId }) {
    return (
        <div className="newsCard">
            <img src={cover} alt="cover" />
            <h3 className="title">{title}</h3>
            <p className="publishDate">{publishDate}</p>
            <p className="author">By Author #{authorId}</p>
        </div>
    );
}
